import React from 'react';

import './app-header.css';
import styled from "styled-components";

const Header = styled.div`
  display: flex;
  align-items: flex-end;
  justify-content: space-between;
`

const AppHeader = () => {
  return (
      <Header>
        <h1>Stepa Dudar</h1>
        <br/><br/>
        <h2>5 posts, 0 likes</h2>
      </Header>
  )
};

export default AppHeader;
